css:
latex-progress-indicator {
  color: #4f99d3;
}
latex-progress-indicator .dot {
  opacity: 0;
  -webkit-animation: dot 1.0s infinite;
}
latex-progress-indicator .dot.one {
  -webkit-animation-delay: 0.0s;
}
latex-progress-indicator .dot.two {
  -webkit-animation-delay: 0.2s;
}
latex-progress-indicator .dot.three {
  -webkit-animation-delay: 0.3s;
}
latex-error-indicator,
latex-error-indicator a {
  color: #ce4045;
}
@-webkit-keyframes dot {
  0% {
    opacity: 0;
  }
  50% {
    opacity: 0.1;
  }
  100% {
    opacity: 1;
  }
}
